userDefinedLinkHintCss:
input#vomnibarInput.vimiumReset {
  color: #eceff4 !important;
  background-color: #2e3440 !important;
}
#vomnibar {
  border-color: #2e3440;
  background-color: #2e3440;
  border-radius: 50px;
  border: none;
  box-shadow: 0px 4px 40px rgba(46, 52, 64, 0.55);
  top: 30px;
  max-width: 650px;
  width: calc(100% - 62px);
  margin: 0 auto;
  left: 0;
  right: 0;
}
#vomnibar .vomnibarSearchArea {
  background-color: #2e3440;
  border-bottom: #2e3440;
  background: none;
  border-radius: 0;
  border: none;
  padding: 0;
}
#vomnibar input {
  border-color: #2e3440;
  color: #eceff4;
  background-color: #2e3440;
  border-radius: 5px;
  border: none;
  box-shadow: none;
  font-size: 18px;
  height: 50px;
  margin: 0;
  outline: none;
  padding: 0 15px;
  vertical-align: middle;
}
#vomnibar ul {
  background-color: #2e3440;
  margin: 0;
}
#vomnibar li {
  border-bottom: #2e3440;
}
#vomnibar li .vomnibarUrl {
  color: #88c0d0;
}
#vomnibar li .vomnibarMatch {
  color: #ebcb8b;
}
#vomnibar li.vomnibarSelected {
  background-color: #3b4252;
}
#vomnibar li em .vomnibarMatch, #vomnibar li .vomnibarTitle .vomnibarMatch {
  color: #88c0d0;
}
#vomnibar li em, #vomnibar li .vomnibarTitle {
  color: #eceff4;
}
